(27,'2023-08-28 11:15:18.783447','2023-09-06 08:39:10.491287','<p><strong>- 2024학년도 대학수학능력시험 응시원서 접수 안내 -</strong></p><p>1. 접수기간: 2023. 8. 24.(목) ~ 9. 8.(금) (평일 09:00~17:00, 토요일 및 공휴일 제외)</p><p><br></p><p>2. 접수처</p><p>1) 재학생: 재학 중인 고등학교</p><p>2) 졸업생: 출신 고등학교 행정실</p><p><br></p><p>3. 준비물</p><p>- 공통: 신분증, 여권용 규격사진(가로3.5cm * 세로4.5cm) 2장(&lt;첨부6&gt; 여권사진규격_외교부 참조)</p><p>- 추가서류: &lt;첨부3&gt; 2024학년도 수능원서 접수자별 준비물 참조</p><p><br></p><p>4. 응시수수료</p><p><br></p><p>- 4개 영역 이하 37,000원, 5개 영역 42,000원, 6개 영역 47,000원</p><p><br></p><p>5. 문의처: 053) 231-6807</p><p><br></p><p>* 자세한 사항은 붙임을 참고하여 주시기 바랍니다.</p><p><a href=\"https://school.iamservice.net/articles/view/140393696#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(87, 87, 87);\">(첨부1) 2024학년도 대학수학능력시험 시행세부계획 공고문.hwpx</a></p><p><a href=\"https://school.iamservice.net/articles/view/140393696#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(87, 87, 87);\">(첨부2) 2024학년도 대학수학능력시험 응시원서(기록용).hwpx</a></p><p><a href=\"https://school.iamservice.net/articles/view/140393696#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(87, 87, 87);\">(첨부3) 2024학년도 수능원서 접수자별 준비물.hwpx</a></p><p><a href=\"https://school.iamservice.net/articles/view/140393696#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(87, 87, 87);\">(첨부4) 대리접수서약서(서식).hwpx</a></p><p><a href=\"https://school.iamservice.net/articles/view/140393696#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(87, 87, 87);\">(첨부5) 군복무확인서(예시).hwpx</a></p><p><a href=\"https://school.iamservice.net/articles/view/140393696#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(87, 87, 87);\">(첨부6) 여권사진규격_외교부.pdf</a></p>',1,0,'2024학년도 EBS 수능연계교재 수정 사항 안내',6),
(28,'2023-08-28 11:16:00.483349','2023-08-31 03:42:11.310161','<p><strong>EBS에서 발간한 2024학년도 수능연계교재 수정 사항</strong>을 다음과 같이 안내드립니다.</p><p>1.&nbsp; 교재 : 2024학년도<strong> EBS 수능특강, 수능완성</strong> 시리즈</p><p><strong><em>시리즈명과목명</em></strong><em>수능특강독서(2건), 문학(1건), 언어와 매체(2건), 화법과 작문(2건)수학Ⅰ(1건)화학Ⅰ(1건), 생명과학Ⅱ(1건)수능완성독서·문학·언어와 매체(1건)수학Ⅰ·수학Ⅱ·미적분(1건)경제(1건), 동아시아사(2건), 한국지리(1건), 세계지리(1건)물리학Ⅰ(2건), 물리학Ⅱ(2건), 화학Ⅰ(1건), 화학Ⅱ(4건), 생명과학Ⅰ(5건), 생명과학Ⅱ(1건), 지구과학Ⅰ(2건)</em></p><p><a href=\"https://school.iamservice.net/articles/view/140414003#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(87, 87, 87); background-color: transparent;\">2024학년도 EBS 수능완성 시리즈 정오표(230815).xlsx</a></p><p><a href=\"https://school.iamservice.net/articles/view/140414003#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(87, 87, 87); background-color: transparent;\">2024학년도 EBS 수능특강 시리즈 정오표(230815).xlsx</a></p>',2,1,'2024학년도 EBS 수능연계교재 수정 사항 안내',6),
