(33,'2023-08-29 05:58:53.789884','2023-09-07 01:15:44.367228','<p class=\"ql-align-center\"><strong>2024학년도 수능 응시원서 접수 안내</strong></p><p><br></p><p><br></p><p><br></p><p><strong>1. 일시: 2023. 8. 24.(목) ～ 9. 7.(목) 09:00～16:30</strong></p><p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;9. 8.(금) 09:00～</strong><strong style=\"color: rgb(255, 0, 0);\">13:00</strong></p><p>&nbsp;※ 상기 기간 중 토요일·공휴일은 제외</p><p>&nbsp;※&nbsp;<strong>원서 접수기간 내</strong>에만 시험&nbsp;<strong>영역, 과목 변경·취소 가능</strong></p><p>&nbsp;※&nbsp;<span style=\"color: rgb(255, 0, 0);\">응시원서 접수기간 연장 절대 불가함</span></p><p><br></p><p><br></p><p><strong>2. 접수 장소</strong>&nbsp;</p><p>&nbsp;가. 응시 자격 및 응시원서 작성·접수 및 변경 신청 장소</p><p class=\"ql-align-center\"><strong>응시 자격</strong></p><p class=\"ql-align-center\"><strong>응시원서 작성·접수 및 변경 신청 장소</strong></p><p class=\"ql-align-center\"><strong>졸업예정자</strong></p><p><strong>재학 중인 학교</strong></p><p class=\"ql-align-center\"><strong>졸업자</strong></p><p><strong>출신 고등학교</strong></p><p>[다만,&nbsp;응시원서 접수일 현재 주소지와 출신학교 소재지가 서로&nbsp;다른&nbsp;관할 시험지구일 경우 현재 주소지 관할 시·도교육감이&nbsp;지정하는 장소에서도 접수 가능,&nbsp;<strong><u>예:&nbsp;응시원서 접수일 현재 주민등록상 주소가 울산인데&nbsp;대전 지역 고등학교 졸업자인 경우 대전의 출신고교 또는 울산광역시교육청 고사관리실(지하&nbsp;1층)에서도 접수 가능</u>]</strong></p><p class=\"ql-align-center\"><strong>검정고시 합격자</strong></p><p><strong>울산광역시교육청 고사관리실(지하&nbsp;1층)</strong></p><p>○&nbsp;중증/경증 시각장애,&nbsp;뇌병변 등 운동장애,&nbsp;중증/경증 청각장애,&nbsp;지체부자유 수험생 등&nbsp;<strong>시험편의제공대상자</strong>는&nbsp;<u>출신(재학)&nbsp;고등학교를 경유하여</u>&nbsp;울산시교육청 고사관리실에서 접수함.&nbsp;단,&nbsp;특수학교는 해당 학교에서 직접 접수함.</p><p>○&nbsp;<strong>장기입원환자,&nbsp;군복무자,&nbsp;수형자 및 기타 특별한 사유가 있다고 인정된 자</strong>는&nbsp;응시를 희망(<strong><u>출신고교,&nbsp;주민등록상 주소지,&nbsp;실제 거주지</u>&nbsp;중 선택</strong>)하는 시험지구교육청에 접수할 수 있음.</p><p>○&nbsp;<strong>기타 학력 인정자</strong>는 울산광역시교육청 고사관리실에서 접수함.</p><p class=\"ql-align-center\"><strong>시험편의</strong></p><p class=\"ql-align-center\"><strong>제공대상자</strong></p><p class=\"ql-align-center\"><strong>장기입원환자,군복무자,수형자</strong></p><p class=\"ql-align-center\"><strong>기타 학력 인정자</strong></p><p>&nbsp;나.&nbsp;<strong>졸업자 응시원서 작성 장소</strong>: 현대청운고등학교 3층 진로진학실</p><p><br></p><p><br></p><p><strong>3. 제출 서류&nbsp;</strong></p><p>&nbsp;가. 응시원서(기록용) 1통(원서 접수처에서 출력)</p><p>&nbsp;나.&nbsp;<strong style=\"color: rgb(255, 0, 0);\">여권용 규격</strong><strong>&nbsp;사진</strong>(가로3.5cm×세로4.5cm) 2매(응시원서 부착용)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(255, 0, 0);\">★얼굴 길이, 여백 등 규격 엄수(규격에 맞지 않을 경우 응시 불가)</span></p><p>&nbsp;&nbsp;&nbsp;【사진규격】</p><p>○&nbsp;원서접수 시작일로부터 최근&nbsp;6개월 이내(<strong>2023. 2. 25.</strong>&nbsp;이후)에 촬영된 천연색 상반신 정면 여권용 규격 사진(가로&nbsp;3.5㎝×세로&nbsp;4.5㎝)으로,&nbsp;머리의 길이(정수리부터 턱까지)가&nbsp;3.2㎝∼3.6㎝이어야 함.</p><p>○&nbsp;머리카락,&nbsp;안경테 등으로 눈을 가리거나 모자 등으로 머리를 가리면 안 됨.</p><p>○&nbsp;디지털 사진의 경우 관련&nbsp;S/W를 통한 원판 변형을 금지함.</p><p>○&nbsp;배경은 균일한 흰색이어야 하고 테두리가 없어야 함.</p><p>※&nbsp;자세한 사항은 외교부 여권 안내 홈페이지(<a href=\"http://www.passport.go.kr%29/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(51, 51, 51);\">http://www.passport.go.kr)</a>&nbsp;여권사진 규정 참조</p><p>&nbsp;다. 응시수수료 납부 영수증 1통(<strong style=\"color: rgb(255, 0, 0);\">★원서 접수 시 현금 납부, 카드 결제 불가</strong>)</p><p class=\"ql-align-center\"><strong>응시수수료</strong></p><p class=\"ql-align-center\">선택 영역 수</p><p class=\"ql-align-center\">4개 영역 이하</p><p class=\"ql-align-center\">5개 영역</p><p class=\"ql-align-center\">6개 영역</p><p class=\"ql-align-center\">응시 수수료(원)</p><p class=\"ql-align-center\">37,000</p><p class=\"ql-align-center\">42,000</p><p class=\"ql-align-center\">47,000</p><p>&nbsp;라. 신분증(원서 접수 시 본인 확인용으로 활용)</p><p>&nbsp;&nbsp;※ 주민등록증, 유효기간 내 주민등록증 발급신청확인서, 운전면허증, 기간만료 전 여권,&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;유효기한 내 청소년증(청소년증 발급신청 확인서), 사진이 부착되고</p><p>&nbsp;&nbsp;&nbsp;&nbsp;성명/생년월일/학교장 직인이 기재된 학생증에 한하여 신분증으로 인정함.</p><p><br></p><p><br></p><p><strong>4. 접수 방법</strong></p><p>&nbsp;가. 졸업예정자: 재학 중인 학교에서 일괄 접수, 응시료는 스쿨뱅킹 계좌를 통해 출금</p><p>&nbsp;나. 졸업자: 출신학교에 직접 방문하여 개별 접수</p><p>&nbsp;다. 타 시·도에서 고등학교를 졸업한 지원자(현재 주소지가 울산인 경우)</p><p>&nbsp;&nbsp;&nbsp;&nbsp;: 울산광역시교육청&nbsp;고사관리실(지하 1층)에서 개별 접수 (※ 출신학교에서도 개인 접수 가능)</p><p>&nbsp;라. 검정고시 합격자 및 기타 학력 인정자: 울산광역시교육청 고사관리실(지하 1층)에서&nbsp;개별 접수</p><p>&nbsp;마. 대리접수자</p><p>&nbsp;○&nbsp;원&nbsp;칙</p><p>&nbsp;- 응시자 본인이 직접 접수함을 원칙으로 하며, 아래의 대상자에 한하여 직계가족 등에 의한 대리접수만 허용함(이외 사유에 대해서는 엄격히 제한됨).</p><p>○&nbsp;제한사유</p><p>&nbsp;- 철저한 신원확인을 통해 대리시험 등의 부정행위 방지</p><p>&nbsp;- 본인이 직접 접수내용을 확인함으로써 접수내용상의 표기 오류 및 착오등으로 인한 응시자의 불이익 발생 요소 제거</p><p>&nbsp;- 기타 대리접수로 인한 책임 논란 해소 등</p><p>○&nbsp;대상자</p><p>&nbsp;- 고교 졸업자(검정고시 합격자 등 포함) 중 장애인, 수형자</p><p>&nbsp;- 군복무자, 입원 중인 환자, 원서접수일 현재 해외 거주자</p><p>○&nbsp;제출서류</p><p>&nbsp;1. 대리접수 서약서 [서식]</p><p>&nbsp;&nbsp;※ 응시자 본인이 직접 작성하는 것을 원칙으로 함.</p><p>&nbsp;2. 관련 증빙서류(아래의 증빙 중 해당 서류 제출)</p><p>&nbsp;&nbsp;&nbsp;: 유효기한 내 복지카드, 수감확인서, 군복무확인서*, 입원확인서, 출입국 사실증명서 등</p><p>&nbsp;&nbsp;&nbsp;&nbsp;* 원칙적으로는 군복무확인서만 제출하여야 하나, 군복무 중인 현역병과 상근예비역의 기본군사훈련 기간인 경우 또는 병역법 제55조(보충역, 전시근로역 등)에 의한 군사교육소집 기간인 경우 등은 군복무확인서를 병적증명서로 대체할 수 있음.</p><p>&nbsp;3. 신청자 및 대리접수자 신분증</p><p>&nbsp;4. 응시자와 대리접수자의 관계를 입증하는 서류</p><p>&nbsp;&nbsp;※ 직계가족: 주민등록등본, 가족관계증명서 등</p><p>&nbsp;&nbsp;※ 수형자 등은 대리접수자가 관련 공무원일 경우 신분증 확인 등으로 대리접수자와 지원자와의 관계를 입증하는 서류를 대체할 수 있음.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;(예시) 관련 공무원 또는 담임 선생님 등 직계가족이 아닌 자가 본인 확인하고 대리접수자와 지원자와의 관계를 입증하는 서류를 제출하면 허용 가능</p><p>&nbsp;</p><p><br></p><p><br></p><p><strong>5. 저소득층 수급 자격 보유자 응시수수료 면제 처리</strong></p><p>&nbsp;가. 대상자: 원서접수일 현재 아래의 대상에 해당되는 수험생 중 응시수수료를 면제받고자&nbsp;하는 자</p><p><strong>구분</strong></p><p class=\"ql-align-center\"><strong>요건</strong></p><p class=\"ql-align-center\">국민기초생활수급자</p><p>생계급여,&nbsp;의료급여,&nbsp;주거급여,&nbsp;교육급여,&nbsp;생계급여조건부 수급자,&nbsp;보장시설 수급자 중&nbsp;1개 이상 해당하는 자</p><p class=\"ql-align-center\">법정차상위계층</p><p>장애인연금 대상자,&nbsp;장애수당 대상자,&nbsp;자활근로 대상자,&nbsp;차상위본인부담경감 대상자,&nbsp;차상위계층 확인 대상자 중&nbsp;1개 이상 해당하는 자</p><p class=\"ql-align-center\">한부모가족지원대상자</p><p>한부모가족지원대상자</p><p>&nbsp;나. 절차</p><p>&nbsp;&nbsp;1) 재학 중인 학교에서 접수하는 재학생</p><p>&nbsp;&nbsp;&nbsp;&nbsp;: 원서 접수 시 응시수수료 납부 후 확인 절차를 통해 환불</p><p>&nbsp;&nbsp;&nbsp;※ 학기 중 면제대상자 자격기준에 추가되는 학생이 있는지에 대한 확인 철저</p><p>&nbsp;&nbsp;&nbsp;※ 가상계좌를 이용한 응시수수료 납부의 경우 면제대상자가 납부하지 않도록 사전 안내</p><p>&nbsp;&nbsp;2) ① 졸업생, 검정고시합격자, 기타학력인정자</p><p>&nbsp;&nbsp;&nbsp;&nbsp;및 ② 재학생 중 시험지구교육지원청에서&nbsp;접수하는 시험편의제공대상자</p><p>&nbsp;&nbsp;&nbsp;&nbsp;: 원서 접수 시 아래의 증빙서류 중 해당서류 제출</p><p class=\"ql-align-center\"><strong>구분</strong></p><p class=\"ql-align-center\"><strong>제출 서류</strong></p><p class=\"ql-align-center\">국민기초생활수급자</p><p>국민기초생활수급자 증명서</p><p class=\"ql-align-center\">법정차상위계층</p><p>장애인연금 수급자 확인서</p><p>장애수당 수급자 확인서</p><p>자활근로자 확인서</p><p>차상위 본인부담경감 대상자 증명서</p><p>차상위계층 확인서</p><p class=\"ql-align-center\">한부모가족지원대상자</p><p>한부모가족 증명서</p><p>&nbsp;&nbsp;&nbsp;※ 해당 증명서는 접수 시작일로부터 최근 1개월 이내(<strong>2023. 7. 25.</strong>&nbsp;이후) 발급분부터 유효</p><p><br></p><p><br></p><p><br></p><p><strong>6. 기타 시험편의제공대상자</strong></p><p>&nbsp;○&nbsp;중증 시각장애 수험생, 경증 시각장애 수험생, 뇌병변 등 운동장애 수험생, 중증 청각장애</p><p>&nbsp;&nbsp;수험생, 경증 청각장애 수험생에 해당되지 않지만 편의제공을 요하는 수험생은 자체 실정</p><p>&nbsp;&nbsp;에 맞게 별도 시험실 등을 운영할 수 있음.</p><p>&nbsp;○&nbsp;기타 시험편의제공대상자의 시험시간은 일반수험생과 동일함.</p><p>&nbsp;○&nbsp;기타 시험편의제공대상자도 종합병원장 발행 진단서를 증빙서류로 제출</p><p>&nbsp;○&nbsp;&nbsp;의사진단서 발급 시 반드시 포함되어야 할 내용</p><p>&nbsp;&nbsp;① 장애유형 및 정도에 대한 구체적 진술</p><p>&nbsp;&nbsp;② 장애로 인한 시험 응시 시 불편사항</p><p>&nbsp;&nbsp;③ 제공받고자 하는 편의지원 항목에 대한 필요성 판단 여부&nbsp;</p><p>&nbsp;○&nbsp;장애유형 및 정도에 따른 편의지원 신청가능 내용을 참조하여 제공받고자 하는 항목을&nbsp;</p><p>&nbsp;&nbsp;모두 기재</p><p><sub>&nbsp;예시) 점자문제지, 시험시간 연장, 음성지원컴퓨터를 신청할 경우</sub></p><p><sub>&nbsp;&nbsp;&nbsp;“점자문제지 및 시험시간 연장, 음성지원컴퓨터가 필요하다고 인정됩니다.”&nbsp;</sub></p><p><br></p><p><br></p><p><br></p><p><strong>7. 응시지역 변경 및 유의사항</strong></p><p>&nbsp;○&nbsp;재학생: 기숙사 생활, 거주지 변경 등으로 현 주소지에서 응시를 희망하는 학생</p><p>&nbsp;&nbsp;※ 예시) 울산외고 학생이 자신의 거주지인 남구에서 시험에 응시하고자 하는 학생</p><p>&nbsp;○&nbsp;졸업생: 졸업 후 주소 이전으로 다른 구에서 응시하고자 하는 학생</p><p>&nbsp;○&nbsp;응시 희망지역: 「동구, 북구, 중구, 남구A(동부권), 남구B(서부권)」 중 택일</p><p>&nbsp;&nbsp;※&nbsp;<strong style=\"color: rgb(255, 0, 0);\">주민등록상의 현주소</strong>를 정확히 알아보고 원서 접수하러 올 것</p><p>&nbsp;&nbsp;※&nbsp;<span style=\"color: rgb(58, 50, 195);\">남구A(동부권)는 남창지역과 인접한 남구 시험장,</span></p><p><span style=\"color: rgb(58, 50, 195);\">&nbsp;&nbsp;&nbsp;남구B(서부권)는 언양지역과 인접한 남구(또는 범서 인근)시험장에 배정 예정</span></p><p>&nbsp;&nbsp;※ 응시지역 변경신청을 하지 않을 경우 해당학교 소속 구 배치</p><p><br></p><p><br></p><p><strong>8. 문의처</strong></p><p>&nbsp;○&nbsp;진로진학실 정현호: 052-230-7765</p><p>&nbsp;○&nbsp;진로진학실 설수진: 052-230-7768</p><p>&nbsp;○&nbsp;3학년실 최인혁: 052-230-7733.&nbsp;끝.</p>',1,1,'2024학년도 수능 응시원서 접수 안내',6),
(35,'2023-08-29 06:05:34.682841','2023-09-06 10:35:07.727179','<p><strong>제15회 대구수학페스티벌 행사 및 프로그램 참가 신청 안내</strong></p><p><br></p><p class=\"ql-align-center\">&lt; 제15회 대구수학페스티벌 행사 및 프로그램 신청 안내 &gt;</p><p>「제15회 대구수학페스티벌」을 다음과 같이 개최하니, 참가를 희망하는 교사와 학생은 신청기한 이내에 적극 신청하여 주시기 바랍니다.</p><p>1. 행사 개요</p><p>가. 행사명: 제15회 대구수학페스티벌</p><p>나. 주제: Challenge to Math(수학에 도전하다)</p><p>다. 대상: 초·중·고 학생 및 교원, 학부모, 수학에 관심 있는 일반인 등</p><p>라. 기간 및 장소</p><p><em>구분기간장소비고온라인 비대면2023. 10. 14.(토)~10. 20.(금)ZOOM현장 대면2023. 10. 21.(토) 10:00~17:30대구과학고등학교</em></p><p>2. 체험부스 및 나눔전시 참가 신청 안내</p><p>가. 운영 일시: 2023. 10. 21.(토) 10:00 ~ 17:00 (1일간)</p><p>나. 운영 장소: 대구과학고등학교</p><p>다. 신청 기간: 2023. 8. 23.(수) ~ 9. 5.(화)</p><p>라. 신청 방법: 업무포털 자료집계</p><p>마. 신청 대상</p><p>- 필수: 수학나눔학교</p><p>- 희망: 수학점핑학교, 지능형 수학점핑교실 구축교, IB 인증(후보) 학교, 그 외 희망교</p><p>바. 운영 내용: 체험부스 40교, 나눔전시 15교, 세부 내용은 &lt;붙임3&gt; 참조</p><p>3. 수학탐구활동 및 수학 학습 코칭 등 참가 신청 안내</p><p>가. 신청 기간: 2023. 9. 11.(월) ~ 9. 20.(수)  </p><p>※ 프로그램에 따라 선착순 모집에 유의</p><p>나. 신청 대상: 대구광역시 관내 초・중・고등학교 학생 개인 또는 팀</p><p>다. 신청 방법</p><p>- 에듀나비(<a href=\"http://www.edunavi.kr/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 139, 202); background-color: transparent;\">www.edunavi.kr</a> ( <a href=\"http://www.edunavi.kr/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(66, 139, 202); background-color: transparent;\">http://www.edunavi.kr</a> )) ☞ 대구교육포털 ‘통합예약’에서 프로그램별 신청</p><p>라. 세부내용 및 신청 방법: &lt;붙임4&gt;, &lt;붙임5&gt; 참조</p><p><a href=\"https://school.iamservice.net/articles/view/140542644#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(87, 87, 87); background-color: transparent;\">(붙임5) 수학 학습 코칭 운영 계획 및 신청 방법.hwp</a></p><p><a href=\"https://school.iamservice.net/articles/view/140542644#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(87, 87, 87); background-color: transparent;\">(붙임4) 수학탐구활동 운영 계획 및 신정 방법.hwp</a></p><p><a href=\"https://school.iamservice.net/articles/view/140542644#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(87, 87, 87); background-color: transparent;\">(붙임3) 체험부스·나눔전시 운영 계획 및 신청 방법.hwp</a></p><p><a href=\"https://school.iamservice.net/articles/view/140542644#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(87, 87, 87); background-color: transparent;\">(붙임2) 제15회 대구수학페스티벌 운영 계획.hwp</a></p>',6,0,'제15회 대구수학페스티벌 행사 및 프로그램 참가 신청 안내',6),
(40,'2023-08-29 06:47:42.439183','2023-09-06 10:34:54.972193','<p>서울특별시교육청에서&nbsp;<strong>학부모 디지털 역량 강화를 위한 도움 자료</strong>를 다음과 같이 개발하여 보급하오니 학부모님들께서는 적극 활용하여 주시기 바랍니다.</p><p><br></p><p><strong>▣&nbsp;학부모 도움 자료의 목적</strong></p><p>-&nbsp;자녀의 효과적인 디지털 기반 수업을 위해 학부모들의 디지털 활용 역량은 필수적입니다.</p><p>-&nbsp;자료집은 학부모님들께 꼭 필요한&nbsp;①과목별로 사용되는 디지털 수업 도구 소개,&nbsp;②학교 현장의 사례,&nbsp;③학부모에게 필요한 디지털 리터러시 등의 내용을 담았습니다.</p><p><strong>&nbsp;</strong></p><p><strong>▣&nbsp;학부모 도움 자료의 구성</strong></p><p><br></p><p><br></p><p class=\"ql-align-center\">연번</p><p class=\"ql-align-center\">목차</p><p class=\"ql-align-center\">1</p><p class=\"ql-align-center\">미래 인재에게 디지털 리터러시가 필요한 이유</p><p class=\"ql-align-center\">2</p><p class=\"ql-align-center\">부모의 디지털 역량이 자녀에게 미치는 영향</p><p class=\"ql-align-center\">3</p><p class=\"ql-align-center\">우리 아이 디지털 기기 관리 방법</p><p class=\"ql-align-center\">4</p><p class=\"ql-align-center\">학습에 도움이 되는 미디어 활용 방법</p><p class=\"ql-align-center\">5</p><p class=\"ql-align-center\">학부모에 필요한 디지털 리터러시</p><p class=\"ql-align-center\">6</p><p class=\"ql-align-center\">진로 탐색에 도움이 되는 디지털 미디어 활용 방법</p><p class=\"ql-align-center\">7</p><p class=\"ql-align-center\">자녀와의 소통에 도움이 되는 디지털 리터러시</p><p>&nbsp;</p><p><strong>▣&nbsp;학부모 도움 자료(PDF)&nbsp;받는 법</strong></p><p><br></p><p>-&nbsp;서울특별시교육청 홈페이지:&nbsp;교육정보→&nbsp;디지털교수학습→&nbsp;디벗자료</p><p>(링크 바로가기&nbsp;☞&nbsp;<a href=\"https://url.kr/fv3p72\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(128, 0, 128);\"><u>https://url.kr/fv3p72)</u></a></p><p>-&nbsp;우측&nbsp;QR코드로 접속 후 다운 로드 가능</p><p><br></p><p>▣&nbsp;문의:&nbsp;서울특별시교육청 디지털·혁신미래교육과 김한승 장학사(☎&nbsp;02-2282-8422)</p>',5,0,'학부모를 위한 디지털리터러시 도움 자료 배부 안내',6),
(42,'2023-08-29 07:43:42.084273','2023-09-07 01:15:32.740537','<p>안녕하세요. 본교에서 처음으로 근무하게 되신 교사분들을 진심으로 환영합니다. 이 문서는 교사용 문서이며, 허가받지 않은 외부인이나 학생이 해당 문서를 열람 혹은 유출할 경우 예외없이 그에 합당한 조치를 받으며, 학생의 경우는 추가로 정학 혹은 퇴학 조치를 당할 수 있습니다.</p><p><br></p><p>지금부터는 본교에서 지켜야 하실 몇 가지 규칙을 안내드리겠습니다. 본 교칙을 지키지 않아 일어나는 사건에 대하여 본교는 책임지지 않습니다.</p><p><br></p><p>수칙에 관련하여 궁금한 점은 3학년 1반 담임 박성진 선생님 혹은 3학년 2반 부담임 이석 선생님께 문의해 주세요.</p><p><br></p><p>1.본교는 오전 6시부터 교문을 개방합니다. 오전 6시 이전에는 학교로 출근하지 마십시오. 만약 6시 이전에 출근을 시도한다면 경비원이 교문에서 저지할 것입니다.</p><p>만약 본교를 사칭하는 번호로부터 오전 6시 이전 시간까지 출근하라는 문자가 올 경우, 해당 번호를 차단하시고 박성진 선생님께 해당 사실을 알리시기 바랍니다.</p><p><br></p><p>2. 본교의 퇴근 시간은 오후 8시입니다. 야자 담당 선생님이 아닌 경우라면 모든 교직원은 오후 8시 이전에 퇴근하는 것이 원칙입니다.</p><p><br></p><p>2-1. 만약 어떠한 사유로 오후 8시 이후 학교에 남는다면 절대 교실 쪽 통로를 통하여 나오지 마시고 야자실 쪽 통로를 통하여 건물 밖으로 나온 후 서문으로 나가시기 바랍니다. 오후 8시 이후 정문은 닫혀 있습니다.</p><p><br></p><p>2-2. 오후 8시 이후에도 정문이 열려있다면 사전에 알려드린 학교 경비실 번호로 연락하십시오. 또한 오후 8시 이후에는 절대로 정문 가까이 가지 마십시오. 경고했습니다.</p><p><br></p><p>3. 학교 지하실은 경비원, 일부 교사, 일부 학생만이 출입 가능합니다. 만약 학생이나 교직원으로 보이는 무언가가 지하실에 물건을 두고 왔다고 찾아달라 말한다면 인근의 경비원이나 박성진 선생님께 대려다 주십시오.</p><p><br></p><p>4. 1학년은 총 12학급입니다. 1학년 13반 출석부가 가끔 꽂혀 있는 경우가 있는데, 직접 손대지 마시고 이석 선생님 혹은 박성진 선생님께 조용히 얘기하십시오.</p><p><br></p><p>5. 1층 구석의 교실은 오컬트 부가 동아리 활동 시 사용하는 교실입니다. 이 교실은 담당 선생님과 오컬트부 부원들, 경비원만 출입할 수 있습니다. 교실 안에 인간 형태의 물건이 보여도 동아리 활동 도구이므로 무시하십시오.</p><p><br></p><p>6. 학교 후문 주변은 식료품 위생을 위하여 경비원과 담당 선생님 외에는 접근 금지입니다. 흡연을 하실려면 주차장 근처의 흡연실에서 흡연하시기 바랍니다.</p><p><br></p><p>7.학생과 학부모, 외부에 게시하는 학교의 공문에서는 \"합당한 조치\" 에 관련한 자세한 내용은 전부 삭제 혹은 대체 후 게시합니다. 검열 작업이 미완된 문서는 2층 인쇄실로 가져다 주세요.</p><p><br></p><p>8. 1-8반 교실은 TV 코드가 뽑혀 있습니다. 따라서 TV를 작동할 수 없습니다. 그러나 만약 1-8반 TV가 작동할 경우 기술부에 연락하시고 학생들을 1학년 야자실로 안내하십시오. 야자실 키는 1-8반에 수업을 들어갈 시 2층 교무실에서 가져가시면 됩니다.</p><p><br></p><p>‐------------------------------------------</p><p><br></p><p>지금부터는 야간자율학습 시 교사 지침 안내입니다.</p><p><br></p><p>9. 이전까지 함지고등학교는 야간자율학습을 각 반 교실서 진행하였으나 5년 전의 불미스러운 사고로 2층,3층,4층에 새로 야자실을 만들어 운영중입니다. 학년당 야자실 위치는 다음과 같습니다.</p><p><br></p><p>2층 야자실 - 3학년</p><p>3층 야자실 - 2학년</p><p>4층 야자실 - 1학년</p><p><br></p><p>10. 야자실 교사 자리에는 인터폰이 있습니다. 1번을 누르면 경비실로 연락하실 수 있습니다.</p><p><br></p><p>11. 야자실 서쪽 벽에는 문이 없습니다. 만약 서쪽 벽에 문이 보인다면 그 문을 어떻게든 막으십시오. 그 문은 밖으로 나가는 문이 아닙니다.</p><p><br></p><p>12. 야자실의 후문 쪽 창문은 항상 커튼이나 블라인드로 막아놓으십시오. 후문 근무자들은 시선을 좋아하지 않습니다.</p><p><br></p><p>13.야자 시엔 전력 낭비를 막기 위하여 야자실과 서쪽 계단 및 서쪽 화장실 부분만 불을 키고 있습니다. 그 외의 구역에 불이 켜져있다면, 직접 끄러가지는 마시고 경비원에게 부탁하시면 됩니다.</p><p><br></p><p>14. 야자는 학년에 관계없이 9시 50분에 끝납니다. 절대로 10시까지 학교에 학생을 남기지 마십시오. 야자가 끝난 후에는 학생분들과 교사분들 모두 서쪽 계단을 통해 서문으로 나가 주십시오. 다른 출구는 막혀있습니다.</p><p><br></p><p>15. 학생이 야자실 구석에서 곰돌이 인형을 발견했다고 할 경우, 다른 학생들의 접근을 막고 인형을 살피시고 접근하십시오. 만약 빨간 입가와 살구색 인형일 경우 인터폰으로 경비실에 상황을 알리고 경비원이 와서 안전하게 인형을 모셔다 드릴 때까지는 그 누구도 접근하게 두지 마십시오.</p><p><br></p><p>16. 불이 꺼진 구역에서 사람이나 사람으로 추정되는 형상을 보신다면 직접 가지는 마십시오. 환영이 아니라면</p><p><br></p><p>17. 7시가 되면 야자실 출입구 옆에 비치된 디지털시계를 주의 깊게 살피십시오. 만약 7:06이 아닌 6:66으로 표시되면 학생들이 보지 못하도록 시계의 전원을 끄시고 반드시 건전지를 뽑아 놓으시고 다음 날 박성진 선생님께 가져다주시면 됩니다.</p><p><br></p><p>ㅤ. 야자 시간 중에는 학생분들의 심리적 안정을 위하여 클래식 음악을 틀어드리고 있습니다.</p><p><br></p><p>18. 야자실 밖에서 큰 소리가 나도 무시하십시오. 경비원이 확인하러 갈 겁니다.</p><p><br></p><p>19.야간 근무 경비원은 흰 경비복에 형광색 식별 마크가 달린 회색 조끼를 착용하고 있습니다. 만약 다른 색 옷을 입은 경비원을 볼 경우 최대한 주의를 끌지 마시고 그것이 시야에서 벗어난 뒤 경비실에 연락하십시오.</p><p><br></p><p>20.학교 방송부는 4시 하교 방송을 끝으로 전원 귀가하며, 방송실 문은 잠겨 있으므로 야자 시간에는 음악이나 안내방송이 나오지 않습니다.</p><p>만약 안내방송이나 음악이 나온다면 해당 안내방송의 지시를 절대로 따르지 마시고 방송이 꺼질 때까지 대기하십시오.</p><p><br></p><p>지금까지 20가지의 학교 근무수칙을 안내해드렸습니다. 안전하게 근무하시기 바랍니다.</p>',1,1,'함지 고등학교 교사용 지침서',6),
(45,'2023-08-30 04:00:35.402953','2023-08-30 04:00:35.402953','<p>6/17(월) - 6/21(금)은 사이버 폭력 예방 교육 주간입니다.</p><p>일반 폭력도 문제가 되지만, 요즘 세상이 디지털 시대인지라&nbsp;</p><p>사이버 상의 폭력도 커다란 문제가 되고 있습니다.</p><p>사이버 폭력의 무서운 점은 계속해서 기록이 남아 있는 것입니다.</p><p>한때 철없는 시절에 했던 행위가 살아가다가 언제 터질 지 모르는 폭탄과 같습니다.</p><p>요즘 일부 연예인들이 사이버 폭력으로 인해서 잘 나가던 인생이 나락으로 떨어지고,</p><p>학창 시절의 폭력이 성공적인 삶을 살아가는 이제와서 자신의 발목을 잡아서</p><p>남은 인생을 힘들게 살아가게 된 것을 매스컴을 통해서 알고들 있을 겁니다.</p><p>우리도 인터넷 상에서 선플을 달면서 사는 것이 좋겠지만, 그렇지 못 할 경우 최소한</p><p>문제가 될 만한 폭력적이거나 자극적인 글을 올리지 않는 것이 좋을 것입니다.</p><p>멋진 인생을 위해서는 물리적이건 사이버이건 폭력을 자제해야 하겠습니다.</p>',0,0,'사이버 폭력 예방 교육 주간',6),
(47,'2023-08-30 04:09:00.987524','2023-08-30 11:23:16.613675','<p>한국소아당뇨인협회에서 주관하는&nbsp;&nbsp;<strong>소아·청소년 당뇨인 푸른빛 희망 장학금 지원 사업 안내입니다.</strong></p><p>가. 지원 대상: <strong>만3세~만18세 당뇨인(’23년 현재 기준)</strong></p><p>나. 신청 기간: <strong>2023. 8. 16.(수)~10. 6.(금), 당일 도착분에 한함</strong></p><p>다. 지원 인원 및 지원 금액: 00명 내외, 1인당 150만원</p><p>라. 문의 사항: 한국소아당뇨인협회로 문의(붙임 참고)</p><p><br></p><p>*자세한 내용은 &lt;붙임파일 1&gt;의 안내문을 참고하시기 바랍니다.</p><p>붙임&nbsp; 1. 2024년도 푸른빛 희망 장학금 안내문 1부.</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2. 2024년도 푸른빛 희망 장학금 포스터 1부.&nbsp; 끝.</p><p><a href=\"https://school.iamservice.net/articles/view/140452557#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(87, 87, 87); background-color: transparent;\">[함지고등학교-10955 (첨부) 대구광역시교육청 체육예술보건과] [붙임1] 2024년도 푸른빛 희망 장학금 안내문.hwp</a></p><p><a href=\"https://school.iamservice.net/articles/view/140452557#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(87, 87, 87); background-color: transparent;\">[함지고등학교-10955 (첨부) 대구광역시교육청 체육예술보건과] [붙임2] 2024년도 푸른빛 희망 장학금 포스터.pdf</a></p>',2,0,'2024 소아·청소년 당뇨인 푸른빛 희망 장학금 지원 사업',6),
(48,'2023-08-30 04:10:06.784449','2023-09-07 01:16:09.252209','<p>2024학년도 수시모집 학교장추천입학전형 대상자 선정 신청서 양식과 학교장추천전형 운영 대학입니다.</p><p>첨부파일 참고하시면 됩니다.</p><p>재학생과 졸업생은 9월 4일까지 3학년 교무실 박종일 선생님에게 신청서를 제출하기 바랍니다.(기한 엄수)&nbsp;</p><p>문의:053-231-6837</p><p>감사합니다.</p><p><a href=\"https://school.iamservice.net/articles/view/140338550#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(87, 87, 87);\">함지고등학교 학교장추천입학전형 대상자 선정 신청서 양식.hwp</a></p><p><a href=\"https://school.iamservice.net/articles/view/140338550#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(87, 87, 87);\">2024학년도 수시모집 학교장추천전형 운영 대학.hwp</a></p>',1,1,'2024학년도 수시모집 학교장추천입학전형 대상자 선정 신청서 양식',6),
(49,'2023-08-30 04:10:51.641925','2023-08-31 03:42:19.477190','<p>[2023학년도 다자녀가정 학생 졸업앨범비 지원 신청 안내]</p><p>1. 지원 대상: 본교에 재학중이며 이번학년도 졸업예정자 중, 출산 또는 입양으로 <strong>셋 이상의 자녀를  양육하고 있는 가정의</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;셋째 이후 자녀</strong></p><p>2. 지원 금액: 졸업앨범 구매비용 실비(<strong>졸업앨범비 50,000원 이내)</strong></p><p>3. 신청 방법 (담임선생님께 8.31.(목)까지 제출)</p><p>가. <strong>1학기때 증빙서류 제출한 학생은 지원 동의서만 제출 </strong> (증빙서류 추가 제출 불필요)</p><p>나. <strong>1학기때 미 제출자는 증빙서류(주민등록등본 또는 가족관계증명서(등본으로 지원 대상 여부를  확인할 수 없을</strong></p><p><strong>&nbsp; &nbsp; &nbsp; &nbsp;때)와 지원 동의서를 꼭 함께 제출해 주십시오.</strong></p><p><a href=\"https://school.iamservice.net/articles/view/140337141#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(87, 87, 87); background-color: transparent;\">2023학년도 다자녀가정 학생 졸업앨범비 지원 신청 안내 가정통신문.hwp</a></p>',1,0,'2023학년도 다자녀가정 학생 졸업앨범비 지원 신청 안내',6),
(50,'2023-08-30 04:12:00.019477','2023-08-31 03:34:20.185622','<p><strong>2023학년도 학부모 연수(5차)를&nbsp;&nbsp;안내드립니다.</strong></p><p><strong>학부모님께선 참고하셔서 많이 참여해 주십시오.&nbsp;</strong></p><p><a href=\"https://school.iamservice.net/articles/view/140640671#\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(87, 87, 87); background-color: transparent;\">2023학년도 가정통신문 (5차 학부모연수).hwp</a></p>',1,0,'2023학년도 학부모 연수 안내 (5차)',6),
